import { Route, Switch } from 'react-router';
import '../App.css';
import Header from './Header';
import Start from './Start';
import Step1 from './Step1';
import BottomPanel from './BottomPanel';

function App() {
  return (
    <div className="App">
      <Header />
      <Switch>
        <Route exact path='/'>
          <Start />
        </Route>
        <Route path='/step1'>
          <Step1 />
          <BottomPanel 
          back='/'
          next='/step2'
          />
        </Route>
        <Route path='/step2'>
          <Step1 />
          <BottomPanel 
          back='/step1'
          next='/'
          />
        </Route>
      </Switch>
    </div>
  );
}

export default App;
